import { createContext } from 'react';

export const TokenContext = createContext(null);

export const Token = props => {
  const [query, setQuery] = useState("");

  return (
    <ApiContext.Provider value={[query, setQuery]}>
      {props.children}
    </ApiContext.Provider>
  );
};
